import * as React from 'react';
import { loadTheme } from '../themes';

import { 
  Frame,
  TodoList,
  TextButton
} from '../components';

interface TodoScreenProps {
  [x: string]: any
}

export const TodoScreen: React.FC<TodoScreenProps> = ({ navigation, ...props }) => {
  const theme = loadTheme();
  return (
    <Frame scroll>
      <TodoList
        search
      />
      <TextButton
        onPress={() => navigation.navigate('CreateTodoModal')}
        textStyle={theme.createButtonText}
      >
        Create a new todo
      </TextButton>
    </Frame>
  );
}
